import About from "./routes/About";
import Contact from "./routes/Contact";
import Enroll from "./routes/Enroll";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
    <Switch>
      <Route path='/'>
        <Homw/>
      </Route>
      <Route path='/about'>
        <About/>
      </Route>
      <Route path='/contact'>
        <Contact/>
      </Route>
      <Route path='/enroll'>
        <Enroll/>
      </Route>
      <Route path='/login'>
        <Login/>
      </Route>
    </Switch>


      <Navbar/>
    </div>
  );
}

export default App;
